import React from 'react';
import Card from './Cards';
import logo1 from './images/admin-dashboard-app.PNG';

const App = () => (
    <div>
    <h1 className="heading_style">List of Netflix Series 2021</h1>
            <Card
                key = {1}
                sname = {"Rao"}
                imgsrc = {logo1}
                // link = {val.link}
            />
        );

    </div> 
);

export default App;
